    false,nt"url": null,nt"notes": "This annual narrative report for J. Clark
    Salyer National Wildlife Refuge outlines Refuge accomplishments during the 1999
    calendar year. The report begins with a summary of the year's highlights and weather
    conditions. The report includes a planning section which discusses compliance with
    environmental and cultural resource mandates, and research and investigations. Refuge
    administration is outlined; information about personnel, youth programs, volunteer
    programs, funding, safety, and technical assistance is given. Habitat management
    is also covered; subjects include wetlands, forests, grasslands, haying, fire management,
    and pest control. The wildlife section of the report discusses wildlife diversity,
    endangered and threatened species, waterfowl, marsh birds and waterbirds, shorebirds,
    raptors, other migratory birds, game mammals, other resident wildlife, fisheries
    resources, animal control, marking and banding, and disease prevention and control.
    The public uses of the Refuge described in this report include outdoor classrooms,
    interpretive programs, hunting, trapping, wildlife observation, picnicking, and
    law enforcement. The equipment and facilities section of the report provides information
    about new construction, rehabilitation, major maintenance, equipment utilization
    and replacement, communications systems, computer systems, and energy conservation.
    Items of interest are provided at the end.",nt"license_title": "License Not
